"\u0414\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b/\u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432 \u0422.\u041d. (1882)/\u0418\u0437\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u043e\u0431 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438 \u0437\u0430\u043f\u0440\u0430\u0448\u0438\u0432\u0430\u0435\u043c\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 \u043e \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u0438.png",
