"\u0414\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b/\u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432\u0430 \u0410.\u0424. (1878)/\u0418\u0437\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u043e \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u043e \u0441\u043c\u0435\u0440\u0442\u0438.png",
"\u0414\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b/\u0410\u043d\u0438\u043a\u0435\u0435\u0432 \u0421.\u041f. (1902)/\u0418\u043c\u0435\u043d\u043d\u043e\u0439 \u0441\u043f\u0438\u0441\u043e\u043a \u0431\u0435\u0437\u0432\u043e\u0437\u0432\u0440\u0430\u0442\u043d\u044b\u0445 \u043f\u043e\u0442\u0435\u0440\u044c \u043b\u0438\u0447\u043d\u043e\u0433\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u0430 141 \u0441\u043f 85 \u0441\u0434.jpg",
