"\u0414\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b/\u0410\u043d\u0438\u043a\u0435\u0435\u0432 \u0413.\u0418. (1925)/\u041a\u0430\u0440\u0442\u043e\u0447\u043a\u0430 \u0432.\u0441\u043b\u0443\u0436. \u041f\u0435\u043d\u0437\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u0412\u041f\u041f \u0441\u0442\u0440.2.JPG",
